    'Your symbol and format customizations have been successfully reset for this language.' => 'Twoje dostosowania symboli i formatu zostały pomyślnie zresetowane dla tego języka.',
    'Your theme has been correctly exported: %path%' => 'Twój szablon został poprawnie wyeksportowany: %path%',
    '[1] products were successfully added.' => '[1] produkty zostały pomyślnie dodane.',
    '[1] products were successfully removed.' => '[1] produkty zostały pomyślnie usunięte.',
  ),
  'AdminDashboardHelp' => 
  array (
    'Choose a fixed fee for each order placed in %currency% with %module%.' => 'Wybierz stałą stawkę dla każdego zamówienia złożonego w %currency% z %module%.',
    'Choose a fixed fee for each order placed with a foreign currency with %module%.' => 'Wybierz stałą stawkę dla każdego zamówienia złożonego w obcej walucie z %module%.',
    'Choose a variable fee for each order placed in %currency% with %module%. It will be applied on the total paid with taxes.' => 'Wybierz zmienną stawkę dla każdego zamówienia złożonego w %currency% z %module%. Będzie zastosowana do sumy brutto.',
    'Choose a variable fee for each order placed with a foreign currency with %module%. It will be applied on the total paid with taxes.' => 'Wybierz zmienną stawkę dla każdego zamówienia złożonego w obcej walucie z %module%. Będzie zastosowana do sumy brutto.',
    'For the carrier named %s, indicate the domestic delivery costs  in percentage of the price charged to customers.' => 'Dla przewoźnika %s, podaj koszty krajowej dostawy jako procent ceny dla klientów.',
    'For the carrier named %s, indicate the overseas delivery costs in percentage of the price charged to customers.' => 'Dla przewoźnika %s, podaj koszty zagranicznej dostawy jako procent ceny dla klientów.',
    'Method: Indicate the percentage of your carrier margin. For example, if you charge $10 of shipping fees to your customer for each shipment, but you really pay $4 to this carrier, then you should indicate "40" in the percentage field.' => 'Sposób: Podaj procentowy udział kosztu przewoźnika. Na przykład, jeżeli pobierasz 10 zł opłaty za każdą przesyłkę od klientów, ale faktycznie płacisz 4 zł temu przewoźnikowi, powinieneś podać "40" w polu procentów.',
    'This mode displays sample data so you can try your dashboard without real numbers.' => 'Ten tryb generuje przykładowe dane, więc możesz wypróbować Twój panel na przykładowych wartościach.',
    'You should calculate this percentage as follows: ((total sales revenue) - (cost of goods sold)) / (total sales revenue) * 100. This value is only used to calculate the Dashboard approximate gross margin, if you do not specify the wholesale price for each product.' => 'Powinieneś przeliczyć ten udział następująco: ((dochody ze sprzedaży razem)-(koszt sprzedanych towarów))/(dochody ze sprzedaży razem) * 100. Ta wartość jest używana tylko do przeliczania marży brutto, jeżeli nie określisz ceny zakupu dla każdego produktu.',
    'You should calculate this value by making the sum of all of your additional costs per order.' => 'Powinieneś obliczyć ta kwotę jako sumę wszystkich Twoich dodatkowych kosztów w przeliczeniu na jedno zamówienie.',
  ),
  'AdminShopparametersHelp' => 
  array (
    '%group_name% - All persons who created an account on this site.' => '%group_name% - Wszystkie osoby które założyły konto na tej stronie.',
    '%group_name% - All persons who placed an order through Guest Checkout.' => '%group_name% - Wszystkie osoby które złożyły zamówienie z użyciem Zakupów Gościa.',
    '%group_name% - All persons without a customer account or customers that are not logged in.' => '%group_name% - Wszystkie osoby bez konta klienta lub klienci, którzy nie są zalogowani.',
    'A short description of your shop.' => 'Krótki opis Twojego sklepu.',
    'Activate or deactivate B2B mode. When this option is enabled, B2B features will be made available.' => 'Aktywuj lub dezaktywuj tryb B2B. Kiedy ta opcja jest włączona, niektóre funkcje B2B są dostępne.',
    'Advised for European merchants to be legally compliant (eg: Delivered within 3-4 days)' => 'Zalecane dla europejskich sprzedawców, aby byli zgodni z prawem (np.: Dostawa w ciągu 3-4 dni.)',
    'Advised for European merchants to be legally compliant (eg: Delivered within 5-7 days)' => 'Zalecane dla europejskich sprzedawców, aby byli zgodni z prawem (np.: Dostawa w ciągu 5-7 dni.)',
    'After a customer logs in, you can recall and display the content of his/her last shopping cart.' => 'Po tym jak klient się zaloguje, przywróć i wyświetl zawartość jego/jej ostatniego koszyka.',
    'Allow IP addresses to access the store, even in maintenance mode. Use a comma to separate them (e.g. 42.24.4.2,127.0.0.1,99.98.97.96).' => 'Zezwól adresom IP na dostęp do sklepu, nawet w trybie konserwacji. Użyj przecinka, aby je oddzielić (np. 42.24.4.2,127.0.0.1,99.98.97.96).',
    'Allow guest visitors to place an order without registering.' => 'Zezwalaj odwiedzającym składać zamówienia bez rejestracji.',
    'Allow iframes on text fields like product description. We recommend that you leave this option disabled.' => 'Pozwól na iframes w polach takich jak opis produktu. Zalecamy pozostawienie tej opcji wyłączone.',
    'Automatically apply this value as a discount on all products for members of this customer group.' => 'Automatycznie zastosuje tą wartość jako rabat na wszystkie produkty dla członków tej grupy użytkowników',
    'Automatically updates the shipping costs when you edit an order.' => 'Automatycznie aktualizuje koszty wysyłki podczas edycji zamówienia.',
    'By default, if you search "book", you will have "book", "bookcase" and "bookend".' => 'Domyślnie jeśli wyszukiwane jest „radio” użytkownik będzie miał „radio”, „radiomagnetofon” i „radiostacja”.',
    'By default, the "%add_to_cart_label%" button is hidden when a product is unavailable. You can choose to have it displayed in all cases.' => 'Domyślnie, kiedy produkt jest niedostępny, przycisk "%add_to_cart_label%" jest niewidoczny. Możesz zmienić to, aby wyświetlać go w każdym przypadku.',
    'By default, the fuzzy search is enabled. It means spelling errors are allowed, e.g. you can search for "bird" with words like "burd", "bard" or "beerd".' => 'Domyślnie wyszukiwanie rozmyte jest włączone. Oznacza to, że błędy ortograficzne są dozwolone, np. możesz wyszukać „kołek”, używając takich słów jak „kotek”, „kołem” lub „koło”.',
    'By default, to search for “blouse”, you have to enter “blous”, “blo”, etc (beginning of the word) – but not “lous” (within the word).' => 'Domyślnie, szukając "bluzka", musisz wpisać "bluz", "blu", itp. (początek słowa) - ale nie "luz" (część słowa).',
    'By selecting associated categories, you are choosing to share the categories between shops. Once associated between shops, any alteration of this category will impact every shop.' => 'Wybierając połączone kategorie, wybierasz współdzielenie kategorii pomiędzy różnymi sklepami. Po połączeniu pomiędzy sklepami, jakiekolwiek nadpisanie połączonej kategorii będzie wpływało na wszystkie sklepy do których te kategorie będą przypisane.',
    'Catalog mode disables the shopping cart on your store. Visitors will be able to browse your products catalog, but not buy them.' => 'Tryb katalogu wyłącza koszyk w Twoim sklepie. Użytkownicy będą mogli przeglądać Twoje produkty, ale nie będą mogli ich kupić.',
    'Choose the page which contains your store\'s terms and conditions of use.' => 'Wybierz stronę zawierającą warunki korzystania z Twojego sklepu.',
    'Clean the HTML content on text fields. We recommend that you leave this option enabled.' => 'Wyczyścić zawartość HTML w polach tekstowych. Zaleca się pozostawić tę opcję włączoną.',
    'Contact name (e.g. Customer Support).' => 'Nazwa kontaktu (np. obsługa klienta).',
    'Customers in this group can view prices.' => 'Klienci w tej grupie mogą zobaczyć ceny.',
    'Delivered within 3-4 days' => 'Dostawa w ciągu 3-4 dni',
    'Delivered within 5-7 days' => 'Dostawa w ciągu 5-7 dni',
    'Disable the option to allow customers to reorder in one click from the order history page (required in some European countries).' => 'Wyłącz opcję, pozwalającą klientom powtórne zamawianie jednym kliknięciem z historii zamówień (wymagane w niektórych krajach europejskich).',
    'Disabling this option will require exact spelling for the search to match results.' => 'Wyłączenie tej opcji będzie wymagało dokładnej pisowni, aby wyszukiwanie było zgodne z wynikami.',
    'Display a customized message when the store is disabled.' => 'Wyświetlaj dostosowany komunikat, gdy sklep jest wyłączony.',
    'Display an overview of the addresses, shipping method and cart just before the order button (required in some European countries).' => 'Wyświetla listę adresów, sposobu wysyłki i koszyk tuż przed przyciskiem zamówienia (wymagane w niektórych krajach europejskich).',
    'Display or not the birth date field.' => 'Wyświetlaj lub nie pole data urodzin.',
    'Display or not the partner offers tick box, to receive offers from the store\'s partners.' => 'Wyświetlaj lub nie pole wyboru, potwierdzające chęć otrzymywania ofert od partnerów sklepu.',
    'Display product prices when in catalog mode.' => 'Pokaż ceny, kiedy tryb katalogu jest włączony.',
    'Display the "%add_to_cart_label%" button when a product has combinations' => 'Wyświetl przycisk "%add_to_cart_label%", gdy produkt ma kombinacje',
    'Displayed in emails sent to customers.' => 'Wyświetlany w e-mailach wysyłanych do klientów.',
    'Email template for both .html and .txt.' => 'Szablon e-mail\'a dla .html i .txt.',
    'Emails will be sent to this address.' => 'Wiadomości e-mail będą wysyłane na ten adres.',
    'Enable approximate string matching.' => 'Włącz przybliżone dopasowanie ciągów.',
    'Enable best sellers page on your front office even when its respective module is disabled.' => 'Włącz stronę z najlepiej sprzedającymi się produktami w sklepie, nawet jeżeli odpowiedzialny za to moduł jest wyłączony.',
    'Enable brands page on your front office even when its module is disabled.' => 'Włącz stronę marek na stronie sklepu, nawet jeśli ten moduł jest wyłączony.',
    'Enable more precise search with the end of the word.' => 'Umożliwia bardziej precyzyjne wyszukiwanie zakończenia słowa.',
    'Enable or disable token in the Front Office to improve PrestaShop\'s security.' => 'Włącz lub wyłącz token w "Front Office" w celu poprawy bezpieczeństwa PrestaShop.',
    'Enable search within a whole word, rather than from its beginning only.' => 'Włącz szukanie części słowa, zamiast tylko od jego początku.',
    'Enable suppliers page on your front office even when its module is disabled.' => 'Włącz stronę dostawców na stronie sklepu, nawet gdy ten moduł jest wyłączony.',
    'Enable the automatic indexing of products. If you enable this feature, the products will be indexed in the search automatically when they are saved. If the feature is disabled, you will have to index products manually by using the links provided in the field set.' => 'Włącz automatyczną indeksację produktów. Jeżeli włączysz tą funkcję, produkty będą indeksowane automatycznie po ich zapisaniu. Jeżeli ta funkcja będzie wyłączona, będziesz musiał zaindeksować produkty ręcznie używając linków podanych w tym polu.',
    'Enable this option if you want to activate by default all your manually created new products.' => 'Włącz tę opcję, jeśli chcesz domyślnie aktywować wszystkie ręcznie utworzone nowe produkty.',
    'Enable this option if you want to allow accented characters in your friendly URLs. You should only activate this option if you are using non-Latin characters; for all the Latin charsets, your SEO will be better without this option.' => 'Włącz tę opcję, jeśli chcesz zezwolić na znaki akcentowane w przyjaznych URL-ach. Powinieneś aktywować tę opcję tylko wtedy, gdy używasz znaków spoza alfabetu łacińskiego; dla wszystkich zestawów znaków łacińskich, twoje SEO będzie lepsze bez tej opcji.',
    'Enable this option if you want to display your product\'s attributes in its meta title.' => 'Zaznacz tę opcję, jeśli chcesz pokazać atrybuty produktu w meta tytule.',
    'Enable this option only if you have problems with URL rewriting.' => 'Włącz tą opcję tylko jeżeli masz problemy z przepisywaniem URL na niektórych stronach.',
    'Enable this option only if your server allows URL rewriting (recommended).' => 'Włącz tą opcję, jeżeli Twój serwer zezwala na przepisywanie URL (zalecane).',
    'Enter each alias separated by a comma (e.g. \'prestshop,preztashop,prestasohp\').' => 'Wprowadź każdy alias rozdzielając je przecinkami (\',\') (np. \'prestshop,preztashop,prestasohp\').',
    'Follow [1]this link[/1] to edit the shop name used on the front office.' => 'Użyj [1]tego linku[/1] aby edytować nazwę sklepu używaną na głównej stronie.',
    'For instance, "contacts" for http://example.com/shop/contacts to redirect to http://example.com/shop/contact-form.php' => 'Na przykład, "kontakty" dla http://example.com/shop/contacts przekierować na http://example.com/shop/contact-form.php',
    'For packs of products, stocks can be managed manually or automatically based on individual product stock levels. Further customization is possible for each product.' => 'W przypadku pakietów produktów stany magazynowe mogą być zarządzane ręcznie lub automatycznie, na podstawie stanów magazynowych poszczególnych produktów. Dalsze dostosowanie jest możliwe dla każdego produktu osobno.',
    'Forbidden characters: <>;=#{}' => 'Zabronione znaki: <>;=#{}',
    'How prices are displayed in the order summary for this customer group.' => 'Jak są wyświetlane ceny w podsumowaniu zamówienia dla tej grupy klientów',
    'How to calculate quantity discounts.' => 'Jak obliczać rabaty ilościowe.',
    'If a customer meets multiple conditions, specific prices will be applied in this order of priority, unless a different order has been set for a particular product.' => 'W przypadku spełnienia przez klienta wielu warunków, określone ceny będą stosowane w tej kolejności priorytetu, chyba że dla konkretnego produktu została ustalona inna kolejność.',
    'If an attribute is not available in every product combination, it will not be displayed.' => 'Jeśli atrybut nie jest dostępny w każdej kombinacji produktów, nie zostanie wyświetlony.',
    'If enabled, all messages will be saved in the "Customer Service" page under the "Customer" menu.' => 'Jeżeli włączone, wszystkie wiadomości zostaną zapisane na stronie "Obsługi Klienta" w menu "Klient"',
    'If there are multiple languages enabled on the shop, all URLs are prefixed with the ISO code of the language. Do you want to do this also for the default language, or keep it un-prefixed? If adding a language to a well established single language shop, it\'s a good idea to disable this and avoid changing the URLs.' => 'Jeśli w sklepie włączono wiele języków, wszystkie adresy URL są poprzedzane kodem ISO języka. Czy chcesz stosować to również dla języka domyślnego, czy pozostawić go bez prefiksu? Jeśli dodajesz nowy język do sklepu działającego od dawna tylko w jednym języku, warto tę opcję wyłączyć, aby uniknąć zmiany adresów URL.',
    'If you own an SSL certificate for your shop\'s domain name, you can activate SSL encryption (https://) for all the pages of your shop.' => 'Masz certyfikat SSL dla swojej domeny? Włącz szyfrowanie SSL (https://) na wszystkich stronach sklepu.',
    'If you want to enable SSL on all the pages of your shop, activate the "Enable on all the pages" option below.' => 'Jeśli chcesz włączyć obsługę SSL na wszystkich stronach sklepu, aktywuj opcję "Włącz protokół SSL na wszystkich stronach" poniżej.',
    'If your customer already has this product in their cart, a notification will be displayed on top of the product page. The customer will also be notified if the product they are browsing is part of a pack that\'s in their cart.' => 'Jeśli klient ma już ten produkt w koszyku, na górze strony produktu zostanie wyświetlone powiadomienie. Klient otrzyma również powiadomienie, jeśli przeglądany produkt wchodzi w skład pakietu znajdującego się w jego koszyku.',
    'Image height in pixels. Enter "0" to use the original size.' => 'Wysokość obrazu w pikselach. Wpisz "0" aby użyć oryginalnego rozmiaru.',
    'Image width in pixels. Enter "0" to use the original size.' => 'Szerokość obrazu w pikselach. Wpisz "0" aby użyć oryginalnego rozmiaru.',
    'In stock' => 'W magazynie',
    'In the product page, feature values can be sorted alphabetically by value or by position.' => 'Na stronie produktu wartości cech mogą być sortowane alfabetycznie według wartości lub według pozycji.',
    'In the volume discount table on the product page, display the discounted unit price instead of the unit discount. E.g. If you sell a product for $10 with a discount of $2 from 3 items purchased, the discounted unit price ($8) will be displayed instead of the unit discount ($2).' => 'W tabeli rabatów ilościowych na stronie produktu wyświetl obniżoną cenę jednostkową zamiast rabatu jednostkowego. Np. Jeśli sprzedajesz produkt za 10 PLN z rabatem 2 PLN z 3 zakupionych przedmiotów, zamiast rabatu jednostkowego (2 PLN) zostanie wyświetlona obniżona cena jednostkowa (8 PLN).',
    'Invalid characters:' => 'Nieprawidłowe znaki:',
    'Invalid characters: numbers and' => 'Błędne znaki: liczby i',
    'It allows you to delay shipping if your customers request it.' => 'Umożliwia opóźnienie wysyłki, jeśli klienci o to poproszą.',
    'It checks if the searched term is contained in the indexed word. This may be resource-consuming.' => 'Sprawdza czy poszukiwana fraza zawarta jest w zaindeksowanym słowie. To może wymagać wielu zasobów.',
    'It checks if the searched term is the exact end of the indexed word.' => 'Sprawdza, czy szukana fraza jest dokładnie zakończeniem indeksowanego słowa.',
    'Minimum time required between two requests for a password reset.' => 'Minimalna ilość czasu wymagana pomiędzy dwoma żądaniami resetu hasła.',
    'Name of the related page.' => 'Nazwa powiązanej strony.',
    'Need to hide prices for all groups? Save time, enable catalog mode in Product Settings instead.' => 'Nie chcesz pokazywać cen wszystkim grupom? Oszczędź więc czas i włącz tryb katalogu w Ustawieniach produktu.',
    'Note that the label will be displayed only if backorders are denied.' => 'Pamiętaj, że etykieta będzie wyświetlana tylko wtedy, gdy zamówienia oczekujące zostaną odrzucone.',
    'Note that this option is resource-consuming: the more you search, the longer it takes.' => 'Pamiętaj, że ta opcja pochłania zasoby: im więcej wyszukujesz, tym dłużej to trwa.',
    'Number of products displayed per page. Default is 12' => 'Liczba produktów wyświetlanych na stronie. Wartość domyślna to 12',
    'On backorder' => 'Na zamówienie',
    'Only letters and hyphens are allowed.' => 'Tylko litery i znak minus (-) są dozwolone.',
    'Only letters, numbers and underscores ("_") are allowed.' => 'Tylko litery, cyfry i podkreślenia ("_") są dozwolone.',
    'Only words fewer or equal to this maximum length will be searched.' => 'Wyszukiwane będą tylko słowa mniejsze lub równe tej maksymalnej długości.',
    'Only words this size or larger will be indexed.' => 'Tylko słowa o tej długości lub dłuższe zostaną zaindeksowane.',
    'Order status (e.g. \'Pending\').' => 'Status zamówienia (np. \'oczekuje\').',
    'Out of stock' => 'Oczekiwanie na dostawę',
    'Please enter the index words separated by a "|".' => 'Wpisz wyrazy oddzielone "|".',
    'PrestaShop has three default customer groups:' => 'PrestaShop ma trzy domyślne grupy klientów:',
    'Remember to regenerate email templates in [1]Design > Email theme[/1] after enabling or disabling this feature.' => 'Pamiętaj, aby ponownie wygenerować szablony e-maili w [1]Wygląd > Szablon e-maila[/1] po włączeniu lub wyłączeniu tej funkcji.',
    'Require customers to accept or decline terms of service before processing an order.' => 'Wymagaj od klienta aby zaakceptował warunki korzystania z usługi przed przetworzeniem zamówienia',
    'Search this word instead.' => 'Zamiast tego szukaj tego wyrazu.',
    'Select which category to display on the product page breadcrumbs. It can be the product\'s default category or the category the customer came from.' => 'Wybierz, która kategoria ma być wyświetlana w okruszkach na stronie produktu. Może to być domyślna kategoria produktu albo kategoria, z której klient przyszedł.',
    'Send an email with a summary of the account information after registration.' => 'Po rejestracji wyślij e-mail z podsumowaniem informacji o koncie.',
    'Set a price for gift wrapping.' => 'Ustal cenę opakowania ozdobnego.',
    'Set a tax for gift wrapping.' => 'Ustal podatek od pakowania ozdobnego.',
    'Set to "0" to disable this feature.' => 'Wstaw 0 , aby wyłączyć tę funkcję',
    'Set to 0 to disable this feature.' => 'Ustaw na 0, aby wyłączyć tę funkcję.',
    'Shop registration information (e.g. SIRET or RCS).' => 'Informacja rejestracyjna sklepu (np. NIP, REGON, KRS).',
    'Some of PrestaShop\'s features might not work correctly with a specific configuration of Apache\'s mod_security module. We recommend to turn it off.' => 'Niektóre opcje PrestaShop mogą nie funkcjonować poprawnie przy wyjątkowej konfiguracji modułu Apache mod_security . Rekomendowane jest jego wyłączenie.',
    'Some themes allow your customers to add a product to their cart directly from the product list. You may want to deactivate this feature if a product has combinations, requiring your customers to check product details and choose one of the options.' => 'Niektóre motywy pozwalają Twoim klientom dodać produkt do koszyka bezpośrednio z listy produktów. Możesz chcieć dezaktywować tę funkcję, jeśli produkt ma kombinacje, wymagające od klientów sprawdzenia szczegółów produktu i wybrania jednej z opcji.',
    'Status will be highlighted in this color. HTML colors only.' => 'Status zostanie wyróżniony tym kolorem. Tylko kolory HTML.',
    'Storefront picture.' => 'Zdjęcie witryny lub inne reprezentujące sklep.',
    'Suggest recycled packaging to customer.' => 'Sugeruj opakowanie z surowców wtórnych klientowi.',
    'The group defined for your identified guest customers (used in guest checkout).' => 'Grupa zdefiniowana dla Twoich zidentyfikowanych klientów (używane podczas sprzedaży Gościom).',
    'The group defined for your identified registered customers.' => 'Grupa definiowana dla Twoich zidentyfikowanych zarejestrowanych klientów.',
    'The group defined for your un-identified visitors.' => 'Grupa zdefiniowana dla Twoich niezidentyfikowanych odwiedzających.',
    'The multistore feature allows you to manage several front offices from a single back office. If this feature is enabled, a Multistore page is available in the Advanced Parameters menu.' => 'Funkcja multistore pozwala zarządzać kilkoma front office z jednego back office. Jeśli ta funkcja jest włączona, strona Multistore jest dostępna w menu Parametry zaawansowane.',
    'The order in which products are displayed in the product list.' => 'Porządek wg którego produkty są wyświetlone na liście produktów',
    'The order status will be set to "On backorder" for new orders containing products that are out of stock.' => 'Status zamówienia zostanie ustawiony na „Zamówienie oczekujące” dla nowych zamówień zawierających produkty, których nie ma w magazynie.',
    'This field does not refer to the shop name visible in the front office.' => 'To pole nie odnosi się do nazwy sklepu widocznej na stronie głównej.',
    'This is the root category of the store that you\'ve created. To define a new root category for your store, [1]please click here[/1].' => 'To jest kategoria główna sklepu, który stworzyłeś. Aby zdefiniować nową kategorię główną dla Twojego sklepu, [1]kliknij tutaj[/1].',
    'This option defines how much different can the alternative words found by fuzzy search be. Or, how many characters can be different/missing/added. The default value is 5.' => 'Ta opcja określa, jak bardzo mogą różnić się alternatywne słowa znajdowane przez wyszukiwanie przybliżone (fuzzy search). Innymi słowy – ile znaków może się różnić, brakować lub być dodanych. Domyślna wartość to 5.',
    'This parameter will only be used if the fuzzy search is activated: the lower the value, the more tolerant your search will be.' => 'Ten parametr będzie używany tylko wtedy, gdy włączone jest wyszukiwanie rozmyte: im niższa wartość, tym bardziej tolerancyjne będzie wyszukiwanie.',
    'Title of this page.' => 'Tytuł tej strony.',
    'To add tags, click in the field, write something, and then press the "Enter" key.' => 'Aby dodać tagi, kliknij pole, napisz coś a następnie naciśnij klawisz "Enter".',
    'To hide prices for a specific group, go to [1]Customer Settings > Groups[/1].' => 'Aby ukryć ceny dla określonej grupy, przejdź do [1]Ustawienia klienta > Grupy[/1].',
    'URL rewriting (mod_rewrite) is not active on your server, or it is not possible to check your server configuration. If you want to use Friendly URLs, you must activate this mod.' => 'Przepisywanie URL (mod_rewrite) nie jest aktywne na Twoim serwerze lub nie jest możliwe sprawdzenie konfiguracji Twojego serwera. Jeżeli chcesz używać przyjaznych URL-i musisz aktywować tą funkcję.',
    'Upload an icon from your computer (File type: .gif, suggested size: 16x16).' => 'Prześlij ikonę z twojego komputera (Typ pliku: .gif, sugerowany rozmiar 16x16).',
    'We recommend that you deactivate your store while performing maintenance. Note that it will not disable the webservice.' => 'Zalecamy dezaktywację sklepu podczas przeprowadzania konserwacji. Pamiętaj, że nie spowoduje to wyłączenia usługi sieciowej.',
    'When enabled, admins will access the store front office without storing their IP.' => 'Po włączeniu administratorzy będą uzyskiwać dostęp do front office sklepu bez zapisywania swojego adresu IP.',
    'When enabled, friendly URL will be updated on every name change for offline products only.' => 'Po włączeniu przyjazny adres URL będzie aktualizowany przy każdej zmianie nazwy, tylko w przypadku produktów offline.',
    'Whether or not to display this store.' => 'Wyświetl sklep lub nie.',
    'With this option enabled, it also gives the good result if you search for “lous”, “ouse”, or anything contained in the word.' => 'Kiedy ta opcja jest włączona, daje także dobre wyniki kiedy szukasz "luz", "uzka" lub cokolwiek zawarte w słowie.',
    'With this option enabled, it only gives one result “book”, as exact end of the indexed word is matching.' => 'Jeśli ta opcja jest włączona to daje tylko jeden wynik "radio", dopasowane jest dokładne zakończenie indeksowanego słowa.',
    'You can choose among 6 different ways of rounding prices. "Round up away from zero ..." is the recommended behavior.' => 'Możesz wybrać spośród 6 różnych sposobów zaokrąglania cen. "Zaokrąglanie w górę" jest zalecanym działaniem.',
    'You can choose when to round prices: either on each item, each line or the total (of an invoice, for example).' => 'Możesz określić kiedy zaokrąglać ceny: albo dla każdej sztuki produktu, dla każdej linii na dokumencie albo dla sumy (np. sumy na rachunku).',
    'You can specify the default behavior for all disabled products. The product page can display a "Discontinued" message or an error page. You can also specify which HTTP response is sent to users. This can be set specifically for each product.' => 'Możesz określić domyślne zachowanie dla wszystkich wyłączonych produktów. Strona produktu może wyświetlać komunikat „Wycofane” lub stronę błędu. Możesz także określić, która odpowiedź HTTP jest wysyłana do użytkowników. Można to ustawić indywidualnie dla każdego produktu.',
    'You can\'t edit the shop group because the current shop belongs to a group with the "share" option enabled.' => 'Ne możesz edytować grupy sklepu, ponieważ obecny sklep należy do grupy z włączoną opcją „współdzielenia”.',
    '[1]Make[/1] sure partner offers are not set as required in the [2]Customers[/2] section of the back office before disabling them. Otherwise, new customers won\'t be able to create an account and [1]proceed[/1] to checkout.' => '[1]Upewnij się[/1], że oferty partnerów nie są ustawione zgodnie z wymaganiami w sekcji [2]Klienci[/2] panelu administracyjnego przed ich wyłączeniem. W przeciwnym razie nowi klienci nie będą mogli utworzyć konta i [1]przejść[/1] do kasy.',
    'characters' => 'znaków',
    'e.g. 10:00AM - 9:30PM' => 'Przykład: 10:00 - 21:30',
  ),
