    'If you disable the ecotax, the ecotax for all your products will be set to 0.' => 'Jeżeli wyłączysz ekopodatek, będzie on dla wszystkich Twoich produktów ustawiony na 0.',
    'Image is displayed when no picture is found.' => 'Obraz jest wyświetlany, gdy nie zostanie znaleziony żaden obraz.',
    'Indicate the format of the postal code: use L for a letter, N for a number, and C for the country\'s ISO 3166-1 alpha-2 code. For example, NNNNN for the United States, France, Poland and many other; LNNNNLLL for Argentina, etc. If you do not want PrestaShop to verify the postal code for this country, leave it blank.' => 'Wskaż format kodu pocztowego: użyj L zamiast litery, N zamiast liczby oraz C zamiast kodu kraju ISO 3166 alfa-2. Na przykład NNNNN w Polsce, we Francji, w USA i wielu innych; LNNNNLLL w Argentynie, itd. Jeżeli chcesz żeby PrestaShop zweryfikował kod pocztowy tego kraju, pozostaw pole puste.',
    'International call prefix, (e.g. 1 for United States).' => 'Międzynarodowy prefiks (np. 48 dla Polski).',
