    'Separate each tag with a comma or press the Enter key.' => 'Oddziel każdy tag przecinkiem lub naciśnij klawisz Enter.',
    'Set specific prices for customers meeting certain conditions.' => 'Ustal indywidualne ceny dla klientów spełniających określone warunki.',
    'Take me out of there!' => 'Zabierz mnie stąd!',
    'The cart rule will be applied to the first "X" customers only.' => 'Rabat ma zastosowanie tylko dla pierwszych X klientów.',
    'The default period is one month.' => 'Domyślny okres to jeden miesiąc.',
    'The email will be sent to all users who have access to the Stock page. To modify permissions, go to [1]Advanced Parameters > Team[/1].' => 'Wiadomość e-mail zostanie wysłana do wszystkich użytkowników, którzy mają dostęp do strony Magazyn. Aby zmodyfikować uprawnienia, przejdź do [1]Parametry zaawansowane > Zespół[/1].',
    'The full filename with its extension (e.g. Book.pdf)' => 'Pełna nazwa pliku z jego rozszerzeniem (np. instrukcja.pdf)',
    'The minimum quantity required to buy this product (set to 1 to disable this feature). E.g.: if set to 3, customers will be able to purchase the product only if they take at least 3 in quantity.' => 'Minimalna ilość wymagana aby kupić ten produkt (ustaw 1 aby wyłączyć tą opcję). Np. jeśli ustawiono na 3, klient będzie mógł kupić ten produkt tylko gdy doda do koszyk 3 produkty lub więcej.',
    'The public name for this attribute, displayed to the customers.' => 'Publiczna nazwa dla tego atrybutu, wyświetlana dla klientów.',
    'The way the attribute\'s values will be presented to the customers in the product\'s page.' => 'Sposób, w jaki wartości atrybutu zostaną przedstawione klientowi na stronie produktu.',
    'This interface allows you to specify the suppliers of the current combination.' => 'Ten interfejs pozwala na określenie dostawców bieżącego produktu i ewentualnie jego kombinacji.',
    'This is the human-readable URL, as generated from the product\'s name. You can change it if you want.' => 'To jest edytowalny ręcznie URL, wygenerowany z nazwy produktu. Jeżeli chcesz, możesz go zmienić.',
    'This restriction applies to the country of delivery.' => 'To ograniczenie odnosi się do kraju dostawy.',
    'This type of product code is specific to Europe and Japan, but is widely used internationally. It is a superset of the UPC code: all products marked with an EAN will be accepted in North America.' => 'Ten typ kodu produktu jest szczególnie dla Europy i Japonii, ale ma również szerokie zasstosowanie w innych krajach. Jest to rozszerzenie kodu UPC: wszystkie produkty oznaczone kodem EAN będą akceptowane w Ameryce Północnej.',
    'This type of product code is widely used in the United States, Canada, the United Kingdom, Australia, New Zealand and in other countries.' => 'Ten rodzaj kodu produktu jest szeroko stosowany w USA, Kanadzie, Wielkiej Brytanii, Australii, Nowej Zelandii i innych krajach.',
    'This will be displayed in the cart summary, as well as on the invoice.' => 'Będzie wyświetlona w podsumowaniu koszyka tak jak i na fakturze.',
    'To add combinations, you first need to create proper attributes and values in [1]%attributes_and_features_label%[/1].' => 'Aby dodać kombinacje, musisz najpierw utworzyć odpowiednie atrybuty i wartości w [1]%attributes_and_features_label%[/1].',
    'To have a different description than your category summary in search results page, write it here.' => 'Jeśli chcesz mieć inny opis niż podsumowanie produktu na stronach wyników wyszukiwania, wpisz go tutaj.',
    'To have a different title from the category name, enter it here.' => 'Aby mieć inny tytuł niż nazwa kategorii, wprowadź go tutaj.',
    'To which category should the page redirect?' => 'Do jakiej kategorii strona powinna przekierowywać?',
    'To which product should the page redirect?' => 'Do jakiego produktu strona powinna przekierowywać?',
    'URL for your IMAP server (ie.: mail.server.com).' => 'Adres URL serwera IMAP (np. mail.serwer.pl).',
    'Unless the \'Accented URL\' option is enabled (in Shop parameters > Traffic & SEO), only letters, numbers, underscores (_), and hyphens (-) are allowed.' => 'Jeśli opcja używania w URL znaków diakrytycznych nie jest włączona (Preferencje > Ruch), możesz używać tylko litery, cyfry, podkreślniki (_) oraz myślniki (-).',
    'Upload a brand logo from your computer.' => 'Wgraj logo marki ze swojego komputera.',
    'Upload a file from your computer (%maxUploadSize% max.)' => 'Prześlij plik z komputera (maksymalnie %maxUploadSize%.)',
    'Upload a supplier logo from your computer.' => 'Wgraj logo dostawcy ze swojego komputera.',
    'Use POP3 instead of IMAP.' => 'Użyj protokołu POP3 zamiast IMAP.',
    'Use the Secure Socket Layer (TLS/SSL) to encrypt the session.' => 'Użyj Secure Socket Layer (TLS/SSL) do szyfrowania sesji.',
    'User to use to connect to your IMAP server.' => 'Użytkownik używany do łączenia się z serwerem IMAP.',
    'Using another image as cover will automatically uncheck this box.' => 'Użycie innego obrazu jako okładki spowoduje automatyczne usunięcie zaznaczenia tego pola.',
    'Validate certificates from the TLS/SSL server.' => 'Sprawdź poprawność certyfikatów z serwera TLS/SSL.',
    'When your product is disabled, choose to which page you’d like to redirect the customers visiting its page by typing the product or category name.' => 'Jeśli Twój produkt jest wyłączony, wybierz stronę, do której chcesz przekierowywać klientów odwiedzających jego stronę przez wpisanie nazwy produktu lub kategorii.',
    'Will appear in the list of suppliers.' => 'Pojawi się na liście dostawców.',
    'Yes, I understand the risks' => 'Tak, rozumiem ryzyko',
    'You can choose a minimum amount for the cart either with or without the taxes and shipping.' => 'Możesz wybrać minimalną wielkość dla koszyka albo netto albo brutto oraz z dostawą lub bez.',
