    'You now have three default customer groups.' => 'Masz teraz trzy domyślne grupy klientów.',
    'Your internal name for this attribute.' => 'Twoja wewnętrzna nazwa dla tego atrybutu.',
    '[1]Invalid token[/1]: direct access to this link may lead to a potential security breach.' => '[1]Niewłaściwy token[/1]: Bezpośredni dostęp do tego linku może spowodować luki w bezpieczeństwie sklepu.',
    '[1]No redirection (200), display product[/1] [2] Do not redirect anywhere, display product as discontinued and return normal 200 response.' => '[1]Brak przekierowania (200), wyświetl produkt[/1] [2] Nie przekierowuj nigdzie, wyświetl produkt jako wycofany i zwróć normalną odpowiedź 200.',
