  'ModulesStatsregistrationsAdmin' => 
  array (
    'A significant increase or decrease in customer registration shows that there has probably been a change to your shop. With that in mind, we suggest that you identify the cause, correct the issue and get back in the business of making money!' => 'Znaczny wzrost lub spadek rejestracji klientów pokazuje, że prawdopodobnie nastąpiła zmiana w Twoim sklepie. Mając to na uwadze, proponujemy określić przyczynę, rozwiązać ten problem i wrócić do zarabiania w biznesie!',
    'Adds a registration progress tab to the Stats dashboard.' => 'Dodaje kartę postępu rejestracji w panelu statystyk.',
    'An advertising campaign can attract an increased number of visitors to your online store. This will likely be followed by an increase in customer accounts and profit margins, which will depend on customer "quality." Well-targeted advertising is typically more effective than large-scale advertising... and it\'s cheaper too!' => 'Kampania reklamowa może przyciągnąć większą ilość odwiedzających. Wzrost ilości kont klientów jest wynikiem, który będzie zależny od jakości kampanii. Dobrze skierowana kampania może być bardziej efektywna niż zakrojona na szeroką skalę reklama... i to jest tańsze!',
    'CSV Export' => 'Eksport CSV',
    'Customer accounts' => 'Konta klientów',
    'Design and user-friendliness are more important than ever in the world of online sales. An ill-chosen or hard-to-follow graphical theme can keep shoppers at bay. This means that you should aspire to find the right balance between beauty and functionality for your online store.' => 'Wygląd i przystępność są jeszcze ważniejsze niż kiedykolwiek: nieprzemyślana lub ciężka do nawigacji struktura i grafika może ograniczyć odwiedzających. Musisz wypośrodkować pomiędzy innowacyjnym designem i łatwością poruszania się przez odwiedzających. Odpowiednia pisownia i przejrzystość powodują więcej zaufania klientów do sklepu.',
    'Here is a summary of what may affect the creation of customer accounts:' => 'Oto podsumowanie tego, co może wpływać na tworzenie kont klientów:',
    'How to act on the registrations\' evolution?' => 'Co robić aby zwiększyć liczbę rejestracji?',
    'If you let your shop run without changing anything, the number of customer registrations should stay stable or show a slight decline.' => 'Jeżeli pozwolisz swojemu sklepowi działać bez zmiany czegokolwiek, ilość rejestracji klientów powinna być stabilna lub może delikatnie maleć.',
    'Number of customer accounts created' => 'Liczba utworzonych kont klientów',
    'Number of visitors who placed an order directly after registration:' => 'Odwiedzający, którzy złożyli zamówienie bezpośrednio po rejestracji:',
    'Number of visitors who stopped at the registering step:' => 'Użytkownicy, którzy zatrzymali się już na etapie rejestracji:',
    'Specials, sales, promotions and/or contests typically demand a shoppers\' attentions. Offering such things will not only keep your business lively, it will also increase traffic, build customer loyalty and genuinely change your current e-commerce philosophy.' => 'Promocje, wyprzedaże lub konkursy powodują większe zainteresowanie kupujących. Oferowanie takich rzeczy będzie nie tylko utrzymywać twój biznes pełnią życia, będzie to również zwiększenie ruchu, budowanie lojalności klientów i autentycznie zmieniać swoją aktualną koncepcję e-commerce.',
